import React from "react";
import CustomBarChart from "./CustomBarChart"; // Adjust the import path accordingly

const BarChartData = ({ priceRanges }) => {
  const data = Object.entries(priceRanges || {}).map(([range, count]) => ({
    range,
    count,
  }));

  return (
    <div>
      <h2>Price Ranges Bar Chart</h2>
      <CustomBarChart data={data} />
    </div>
  );
};

export default BarChartData;
